export const DAYS = ["Sun", "Mon", "Tue", "Wed", "Thur", "Fri", "Sat"];

export const MOCKAPPS = [
  { date: new Date(2022, 11, 25), title: "rendre projet react", color: "#238783" },
  { date: new Date(2022, 11, 27), title: "rdv docteur", color: "#708898" },
  { date: new Date(2022, 12, 18), title: "prendre le train", color: "#047106" },
  { date: new Date(2022, 12, 24), title: "Noel", color: "#371395" }
];
